import React, { FunctionComponent } from "react";
import Skin from "../../models/skin";
import { useHistory } from "react-router-dom";

import "./style.css"

type Props = {
    skin: Skin
};

const SkinCard: FunctionComponent<Props> = ({ skin }) => {

    const history = useHistory();

    const goToSkin = (id: number) => {
        history.push(`/skins/${id}`);
    }


    return (
        <li className='card-skin flex-row flex-center-y p15 relative' onClick={() => goToSkin(skin.id)}>
            <img className="card-skin__item" src={skin.picture}></img>
        </li>
    );
}

export default SkinCard;
